import React from "react";
import Navbar from "./Navbar";

export default function Header() {

  const headerStyle = {
    backgroundImage: "url('../images/banner1.png')",
    height: "310px",
    flexShrink: 0,
    backgroundSize: "cover",
    backgroundPosition: "center"
  };

  return (
    <div style={headerStyle}>
      <Navbar />
    </div>
  );
}
